import './Home.css';

function Home() {
    let connectThroughArray = ['videos.', 'campaigns.', 'events.', 'photos.'];

    return(
        <div className='home-container'>
            <section className='home-content'>
                <h2 className='home-header'>
                    Here at <b>Blink</b> Creative Studio
                </h2>
                <p className='home-paragraph'>
                    We convey and connect through <span className='connect-through-array'>{connectThroughArray}</span>
                </p>

                <div className='home-watch-showreel-button'>
                    <a className='home-watch-showreel-button-text' href="#">
                        <div>Watch our showreel</div>
                    </a>
                </div>
            </section>

            <section className='home-image-section'>
                <img className='home-image' src='/assets/header img.png' alt='Header Image'/>
            </section>
      </div>
    );
}

export default Home;
